Renewal_Rate_Metrics_2.query:
q = load "${App.Datasets.Insurance_Policies_tp.FullyQualifiedName}";
q = filter q by date('DateRenewed_Year', 'DateRenewed_Month', 'DateRenewed_Day') in ["13 months ago".."1 month ago"] || date('PreviousRenewalDate_Year', 'PreviousRenewalDate_Month', 'PreviousRenewalDate_Day') in ["13 months ago".."1 month ago"];q= filter q by {{cell(Renewal_rate_over_ti_1.selection,0,"DateRenewed_Year").asEquality("DateRenewed_Year")}} && {{cell(Renewal_rate_over_ti_1.selection,0,"DateRenewed_Month").asEquality("DateRenewed_Month")}} || {{cell(Renewal_rate_over_ti_1.selection,0,"DateRenewed_Year").asEquality("PreviousRenewalDate_Year")}} && {{cell(Renewal_rate_over_ti_1.selection,0,"DateRenewed_Month").asEquality("PreviousRenewalDate_Month")}} ;
q = filter q by 'IsActive' == "true";
q = group q by all;
q = foreach q generate count() as 'count', sum('GrossWrittenPremium') as 'sum_GrossWrittenPremium';
q = limit q 2000;

RenewalPololiciesDet_1.query:
q = load "${App.Datasets.Insurance_tp.FullyQualifiedName}";
q = filter q by 'POLICY_STATUS' == "RENEWAL";
q = foreach q generate 'ICA_NAME' as 'Name', 'Insurance_PRODUCT_FAMILY' as 'Product Family', 'Insurance_PRODUCT_ID' as 'Product ID', 'Insurance_PRODUCT_NAME' as 'Product Name', 'Insurance_PRODUCT_TYPE' as 'Product Type', 'TERM_LENGTH' as 'Term Length', 'written_base_premium' as 'Premium', 'RenewalChance' as 'RenewalChance';
q = limit q 10000;

RenewalCalendar_1.query:
q = load "${App.Datasets.Insurance_tp.FullyQualifiedName}";
q = filter q by 'POLICY_STATUS' == "RENEWAL";
q = group q by ('expiry_Year', 'expiry_Month', 'expiry_Day');
q = foreach q generate 'expiry_Year' + "~~~" + 'expiry_Month' + "~~~" + 'expiry_Day' as 'expiry_Year~~~expiry_Month~~~expiry_Day', sum('written_base_premium') as 'sum_GrossWrittenPremium', unique('POLICY_PRODUCT_ID') as '# Policies';
q = order q by 'expiry_Year~~~expiry_Month~~~expiry_Day' asc;
q = limit q 2000;

Premium_from_renewed_1.query:
q = load "${App.Datasets.Insurance_Policies_tp.FullyQualifiedName}";
q = filter q by 'IsActive' == "true";q = filter q by date('DateRenewed_Year', 'DateRenewed_Month', 'DateRenewed_Day') in ["13 months ago".."1 month ago"] || date('PreviousRenewalDate_Year', 'PreviousRenewalDate_Month', 'PreviousRenewalDate_Day') in ["13 months ago".."1 month ago"];
 q= filter q by {{cell(Renewal_rate_over_ti_1.result,0,"DateRenewed_Year").asEquality("EffectiveDate_Year")}} && {{cell(Renewal_rate_over_ti_1.selection,0,"DateRenewed_Month").asEquality("EffectiveDate_Month")}};
