q = foreach q generate 'EffectiveDate_Year','EffectiveDate_Month','EffectiveDate_Year' + "~~~" + 'EffectiveDate_Month' as 'EffectiveDate_Year~~~EffectiveDate_Month', sum('GrossWrittenPremium') as 'sum_GrossWrittenPremium';
q = order q by 'EffectiveDate_Year~~~EffectiveDate_Month' asc;
q = limit q 2000;

RenewedPoliciesOverT_1.query:
